sis.</span></p>','image/blog/IMG-1625479502328.PNG',1,1),(26,'I am Done with You!','2021-07-29 04:05:40',0,'<p><span style=\"color: rgb(0, 0, 0);\">Indonesia posted four-digit </span><strong style=\"color: rgb(0, 0, 0);\">COVID-19 </strong><span style=\"color: rgb(0, 0, 0);\">fatality figures for the 13th consecutive day on Wednesday despite a dip in new cases in the official data and claims from authorities that the situation has relatively improved following the implementation of stricter activity curbs on July 3. Given the inconsistent and underreported </span><strong style=\"color: rgb(0, 0, 0);\">COVID-19</strong><span style=\"color: rgb(0, 0, 0);\"> data collection since the beginning of the outbreak last year, the number of deaths is thought to be the only reliable marker for demonstrating the true scale of the pandemic in the country. But now concerns are mounting that the figures reported from the regions could be much higher, with the government not including deaths outside of healthcare facilities in its daily official tally. On Wednesday, the country reported 1,824 confirmed coronavirus-related deaths, just a day after smashing past the 2,000-fatalities mark and bringing.</span></p>','image/blog/IMG-1627533211500.png',1,1),(27,'React Spotify','2021-08-09 03:47:57',4,'<p>You can listen to <em><u>every single song</u></em> without <strong>ads </strong>and <strong>subscriptions</strong>!</p>','image/blog/IMG-1628485078128.png',1,1),(28,'King Zlatan','2021-08-24 09:49:18',13,'<p><span style=\"background-color: rgb(250, 250, 250); color: rgb(0, 0, 0);\">AC Milan akan menghadapi Sampdoria pada pekan pertama Serie A di Stadio Luigi Ferraris, Selasa (24/8) dini hari WIB. Menjelang laga, pelatih Milan Stefano Pioli memberikan perkembangan terakhir kondisi timnya. Mantan juru taktik Lazio itu menyebut bahwa striker utama mereka, Zlatan Ibrahimovic, belum bisa tampil di laga nanti Striker asal Swedia itu masih belum sembuh dari cedera lutut yang dialaminya pada Mei lalu saat AC Milan jumpa Juventus di Serie A 2020/21. </span></p><p><br></p><p><span style=\"background-color: rgb(250, 250, 250); color: rgb(0, 0, 0);\">Absennya Ibrahimovic, membuat Milan gagal mewujudkan duet striker berpengalaman bersama Olivier Giroud. Secara fisik Ibrahimovic lebih baik, meskipun dia masih belum berlatih dengan anggota tim lainnya. Minggu depan akan menjadi penting baginya karena dia akan bekerja dengan ritme normal dan berlatih dengan bola,\" ungkap Pioli dilansir laman resmi klub. Meski sudah ikut berlatih, mantan penggawa Barcelona itu masih perlu melakukan pemulihan cedera. Rencananya jika tidak ada halangan, Ibrahimovic bisa kembali merumput pada pertengahan September nanti. </span></p><p><br></p><p><span style=\"background-color: rgb(250, 250, 250); color: rgb(0, 0, 0);\">Bagi Pioli, Ibrahimovic merupakan sosok pemimpin yang baik di timnya. Kehadirannya sangat bagus untuk memompa beberapa penggawa muda yang dimiliki Rossoneri. \"Jika semuanya berjalan seperti yang kami harapkan, dia (Ibrahimovic, red) bisa kembali setelah jeda internasional (September),\"</span></p>','/image/blog/IMG-1629801929355.JPG',1,1);
